// ============================================================
// ODTWARZANIE LOGIKI CLAY: .map().join()
// ============================================================

// 1. Pobieramy wszystkie wiersze z wejścia
const items = $input.all();

// 2. Mapujemy każdy element na format "Nazwa Firmy; ID Firmy"
const formattedList = items.map(item => {
  const data = item.json;

  // Zabezpieczenie: jeśli brak nazwy lub ID, wstaw pusty ciąg (tak jak operator || "" w Clay)
  const name = data["Company Name"] || "";
  const id = data["Company ID"] || "";

  return `${name}; ${id}`;
});

// 3. Łączymy wszystko w jeden string oddzielony przecinkiem i spacją
const resultString = formattedList.join(", ");

// 4. Zwracamy wynik jako jeden obiekt JSON
return {
  json: {
    companies_list_formatted: resultString, // To jest Twój wynik
    count: items.length
  }
};

// ============================================================
// GENERATOR LINKU SALES NAVIGATOR (Poprawiona Wersja)
// ============================================================

// 1. Pobierz wszystkie elementy wejściowe (19 firm)
const items = $input.all();

// Twój Link z Teslą (Base URL)
const baseLink = "https://www.linkedin.com/sales/search/people?query=(recentSearchParam%3A(id%3A4072880329%2CdoLogHistory%3Atrue)%2Cfilters%3AList((type%3ACURRENT_COMPANY%2Cvalues%3AList((id%3Aurn%253Ali%253Aorganization%253A15564%2Ctext%3ATesla%2CselectionType%3AINCLUDED%2Cparent%3A(id%3A0))))%2C(type%3ACURRENT_TITLE%2Cvalues%3AList((id%3A79%2Ctext%3AHuman%2520Resources%2520Specialist%2CselectionType%3AINCLUDED)%2C(id%3A45%2Ctext%3AHuman%2520Resources%2520Manager%2CselectionType%3AINCLUDED)%2C(id%3A91%2Ctext%3ARecruiter%2CselectionType%3AINCLUDED)%2C(id%3A444%2Ctext%3ARecruitment%2520Specialist%2CselectionType%3AINCLUDED)%2C(id%3A300%2Ctext%3AHuman%2520Resources%2520Assistant%2CselectionType%3AINCLUDED)%2C(id%3A105%2Ctext%3AHuman%2520Resources%2520Director%2CselectionType%3AINCLUDED)%2C(id%3A483%2Ctext%3AHuman%2520Resources%2520Executive%2CselectionType%3AINCLUDED)%2C(id%3A248%2Ctext%3AHuman%2520Resources%2520Consultant%2CselectionType%3AINCLUDED)%2C(id%3A271%2Ctext%3AHuman%2520Resources%2520Generalist%2CselectionType%3AINCLUDED)%2C(id%3A400%2Ctext%3AHuman%2520Resources%2520Coordinator%2CselectionType%3AINCLUDED)%2C(id%3A268%2Ctext%3ARecruitment%2520Consultant%2CselectionType%3AINCLUDED)%2C(id%3A495%2Ctext%3ATechnical%2520Recruiter%2CselectionType%3AINCLUDED)%2C(id%3A13195%2Ctext%3ASenior%2520Human%2520Resources%2520Recruiter%2CselectionType%3AINCLUDED)%2C(id%3A609%2Ctext%3ARecruitment%2520Manager%2CselectionType%3AINCLUDED)%2C(id%3A1094%2Ctext%3AInformation%2520Technology%2520Recruiter%2CselectionType%3AINCLUDED)%2C(id%3A921%2Ctext%3ADirector%2520of%2520Recruiting%2CselectionType%3AINCLUDED)%2C(id%3A1827%2Ctext%3ARecruitment%2520Coordinator%2CselectionType%3AINCLUDED)%2C(id%3A787%2Ctext%3AExecutive%2520Recruiter%2CselectionType%3AINCLUDED)%2C(id%3A2446%2Ctext%3ATalent%2520Acquisition%2520Specialist%2CselectionType%3AINCLUDED)%2C(id%3A4318%2Ctext%3ATalent%2520Management%2520Specialist%2CselectionType%3AINCLUDED)%2C(id%3A4288%2Ctext%3ATalent%2520Acquisition%2520Manager%2CselectionType%3AINCLUDED)%2C(id%3A2577%2Ctext%3ATalent%2520Manager%2CselectionType%3AINCLUDED)%2C(id%3A21338%2Ctext%3ASenior%2520Talent%2520Acquisition%2520Specialist%2CselectionType%3AINCLUDED)%2C(id%3A6780%2Ctext%3ATalent%2520Director%2CselectionType%3AINCLUDED)))))&sessionId=%2F%2BDjWjZhTnS%2BxIaRqX7Z9w%3D%3D&viewAllFilters=true";

// 2. Budowanie segmentu URL dla firm
// Iterujemy po wszystkich elementach wejścia (items)
const urlSegments = items.map(item => {
  const data = item.json;
  // Pobieramy nazwę i ID. Jeśli brakuje, dajemy puste.
  const name = data["Company Name"] || "";
  const id = data["Company ID"] || "";

  // Pomijamy jeśli brak ID
  if (!id) return null;

  // Kodowanie nazwy (spacje na %2520, dwukropki na %253A itd.)
  const encodedName = encodeURIComponent(name).replace(/%20/g, '%2520');

  // Tworzymy segment dla pojedynczej firmy
  return `(id%3Aurn%253Ali%253Aorganization%253A${id}%2Ctext%3A${encodedName}%2CselectionType%3AINCLUDED%2Cparent%3A(id%3A0))`;
}).filter(segment => segment !== null); // Usuwamy puste wyniki

// 3. Łączymy wszystkie firmy separatorem %2C (przecinek)
const newCompaniesFilter = urlSegments.join('%2C');

// 4. Podmiana w linku (REGEX)
// Szukamy sekcji CURRENT_COMPANY z Teslą
const regex = /(type%3ACURRENT_COMPANY%2Cvalues%3AList\()(.*?)(\)\)\)%2C\(type%3ACURRENT_TITLE)/;

// Sprawdzenie czy Regex pasuje
if (!regex.test(baseLink)) {
    return { json: { error: "Nie znaleziono sekcji 'CURRENT_COMPANY' w Base URL" } };
}

// Wykonujemy podmianę
const finalUrl = baseLink.replace(regex, `$1${newCompaniesFilter}$3`);

// Zwracamy wynik (tylko jeden element, bo link jest jeden dla wszystkich firm)
return {
  json: {
    sales_navigator_url: finalUrl,
    companies_count: urlSegments.length
  }
};

// 1. Get the raw CSV string from the previous node
const csvString = items[0].json.data;

// Safety check
if (!csvString) return [];

// 2. Helper function to safely parse a CSV line (handling quotes)
function parseCSVLine(line) {
  const result = [];
  let start = 0;
  let inQuotes = false;

  for (let i = 0; i < line.length; i++) {
    if (line[i] === '"') {
      inQuotes = !inQuotes; // Toggle quote state
    } else if (line[i] === ',' && !inQuotes) {
      // Found a separator
      let field = line.substring(start, i);
      // Remove surrounding quotes if present
      field = field.replace(/^"|"$/g, '').replace(/""/g, '"');
      result.push(field);
      start = i + 1;
    }
  }
  // Push the last field
  let lastField = line.substring(start);
  lastField = lastField.replace(/^"|"$/g, '').replace(/""/g, '"');
  result.push(lastField);

  return result;
}

// 3. Process the Data
const lines = csvString.trim().split('\n');
const headers = parseCSVLine(lines[0]); // Extract headers from first line

const jsonData = lines.slice(1).map(line => {
  const values = parseCSVLine(line);
  const obj = {};

  headers.forEach((header, index) => {
    // Map headers to values, handling missing trailing columns
    obj[header] = values[index] || "";
  });

  return { json: obj };
});

return jsonData;
